import React from 'react';
import { Route, Switch } from 'react-router-dom';
import MainForm from './MainForm';
import TabTile from './TabTile';




function App() {

  return (
    <Switch>
      <Route exact path="/" component={MainForm} />
      <Route exact path="/tabtile" component={TabTile} />
      <Route exact path="/" component={MainForm} />
    </Switch>

  );
}

export default App;
